import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div style={{ padding: 40 }}>
      <h1>ROUTER TEST</h1>

      <p>
        <Link to="/">Home</Link> |{" "}
        <Link to="/login">Login</Link>
      </p>

      <Routes>
        <Route path="/" element={<h2>HOME PAGE</h2>} />
        <Route path="/login" element={<h2>LOGIN PAGE</h2>} />
      </Routes>
    </div>
  );
}

export default App;
